import React from "react";

function Dashboard() {
  return (
    <div className="container-fluid" style={{ backgroundColor: "#3d3c3c" }}>
      <div className="row">
        <div className="col-md-3">
          {/* Vertical Menu */}
          <div className="menu">
            <ul>
              <li>Menu Item 1</li>
              <li>Menu Item 2</li>
              <li>Menu Item 3</li>
            </ul>
          </div>
        </div>
        <div className="col-md-9">
          {/* Main Content */}
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
